import React from 'react'
import './Navbar.css';
import { Link } from "react-router-dom";

function Navbar(props){

    let {
        login,
        sign
    } = props;

    return(
        <div className='navbar-container'>
            <div className='navbar-logo'>
                <img className="logo-img" src='./images/logo-img.png' />
            </div>
            <div className='navbar-buttons'>
            {
                login &&
                <div className='navbar-btn  btn-login'>
                    <Link className='link-item' to="login">Login</Link>
                </div>
            }
            {
                sign &&
                <div className='navbar-btn  btn-sign'>
                    <Link className='link-item' to="sign">Sign In</Link>
                </div>
            }

            </div>
        </div>
    )
}

export default Navbar;
